import React from "react";

import TemplateForm from "./TemplateForm";

class TemplateCreate extends React.Component {
  render() {
    return (
      <div>
        <h2>Create a Template</h2>
        <TemplateForm />
      </div>
    );
  }
}
export default TemplateCreate;
